<p>The George T Stronach subdivision is one of the larger subdivisions in Nags Head encompassing a couple of miles of semi-oceanfront and <a href="https://www.outerbankshome.com/outer banks/real estate/nags head/oceanfront-homes/" title="Nags Head Oceanfront Homes For sale">oceanfront homes</a> in Nags Head. The subdivision runs from <a href="http://jockeysridgestatepark.com/" title="Jockeys Ridge">Jockey's Ridge State Park</a> north to <a href="https://www.outerbankshome.com/outer banks/real estate/nags head/old-nags-head-place.asp" title="Old Nags Head Place">Old Nags Head Place</a>. In Geo T Stronach you will find a mixture of homes ranging from the small 2 bedroom summer weekend getaways to monster ocean front rental machines with 10+- bedrooms. </p>
